                            Text = "\n          5.3. Отодвинем подвижную пластину с экраном вправо от датчика, установив экран на торце подвижной пластины на метке «8» мерной шкалы. Индикатор d показывал расстояние до объекта.\n          5.4. Зафиксируем показания индикатора и сравним со значением мерной шкалы.\n          5.5. Повторим эксперимент, передвинув влево подвижную пластину с экраном влево на следующую метку мерной шкалы. Зафиксируем показания индикатора и сравним со значением мерной шкалы для каждого из положений подвижной пластины с экраном.\n          5.6. Полученные данные занесем в таблицу 5."
