                            ElementType = 0,
                            LabTemplateId = new Guid("202b2d34-b93e-45db-935b-3a1d050f36bb"),
                            Number = 2,
                            Text = "\n          2. Исследование геркона\n          2.1. Медленно подносить магнит к геркону до момента срабатывания контрольного светодиода.\n          2.2. Оценить расстояние, на котором произошло срабатывание геркона.\n          Срабатывание геркона произошло на расстоянии 1.2 см от магнита.\n          2.3. Сделать выводы о минимальном расстоянии, на котором произошло срабатывание геркона.\n          Благодаря высокой чувствительности геркон можно успешно применять для различных датчиков положения и концевых выключателей. Из недостатков – хрупкая конструкция и намагничивание контактов со временем эксплуатации.\n          3. Исследование оптического датчика\n          3.1. Установить кодовую пластину в корпус оптического датчика.\n          3.2. Передвигать пластину влево/вправо и следить за работой контрольного светодиода.\n          Исходя из измерений, ширина окна оптического датчика составляет 1.6 см (2,4-0,8 см)\n          3.3. Сделать выводы о принципе работы оптического датчика-выключателя.\n          Оптический датчик состоит из источника (излучателя) и приемника оптического излучения, которые могут располагаться в одном или в разных корпусах Датчики такого типа используются для автоматизации любых промышленных процессов, в робототехнике, системах контроля, обработки и монтажа. Из достоинств такого вида датчика можно выделить высокую чувствительность и скорость срабатывания. Из недостатков: не работает в агрессивных средах и в средах с высокой степенью загрязнения.\n          4. Исследование индуктивного датчика\n          4.1. Медленно подвести металлическую пластину к индуктивному датчику, до момента срабатывания контрольного светодиода.\n          Расстояние от датчика, на котором сработал светодиод, составило 0,4 см.\n          4.2. Сделать выводы о минимальном расстоянии, на котором произошло срабатывание индуктивного датчика.\r\n		Поскольку расстояние до срабатывания датчика оказалось существенно мало, по сравнению с герконом, можно сделать вывод о невысокой чувствительности такого датчика. И достоинств можно отметить очень простую конструкцию и возможность работать во всевозможных агрессивных средах."
